const Sidebar = () => {
    
    return (
      <React.Fragment>
      
      
      <ul className="sidebar-list">
      
        <nav className="sidebar-nav"><a href="#home"><h3>Home</h3></a></nav>
        <nav className="sidebar-nav"><a href="#map"><h3>Map</h3></a></nav>
        <nav className="sidebar-nav"><a href="#contact"><h3>Contact</h3></a></nav>
